// import React from 'react';
// import ReactApexChart from 'apexcharts';
import Boxplot from 'react-boxplot';
import  computeBoxplotStats from 'react-boxplot/dist/stats'
function Modal()  {
     

var values = [
    14, 15, 16, 16, 17, 17, 17, 17, 17, 18, 18, 18, 18, 18, 18, 19,
    19, 19, 20, 20, 20, 20, 20, 20, 21, 21, 22, 23, 24, 24, 29,
];
 
React.render(
    React.createElement(Boxplot, {
        width: 400,
        height: 25,
        orientation: 'horizontal',
        min: 0,
        max: 30,
        stats: computeBoxplotStats(values),
    }),
    document.getElementById('chart')
);
}

export default Modal;
